import React from 'react'
import { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'


function Home() {
  const navigate = useNavigate();

  useEffect(() => {
    if (!localStorage.getItem('token')) {
      navigate("/signup");
    }
  }, [navigate])


  return (
    <div>
      welcome to 
    </div>
  )
}

export default Home
